import React from "react";
import styles from "../scss/NewestPost.module.scss";
import { Row, Col } from "react-bootstrap";
import { Link } from "react-router-dom";
const NewestPost = () => {
  return (
    <Row className={styles.row}>
      <Col
        xs={12}
        sm={12}
        md={6}
        lg={6}
        className={`${styles.col} ${styles.newest}`}
      >
        <img src={require("../../img/images/banner-cut.png").default} alt="" />
        <Link>G-STORE – THỜI ĐIỂM VÀNG ĐỂ ĐẨY MẠNH KINH DOANH ONLINE</Link>
        <p>27-02-2021</p>
      </Col>
      <Col
        xs={12}
        sm={12}
        md={5}
        lg={5}
        className={`${styles.col} ${styles.column}`}
      >
        <div className={styles.news}>
          <img src={require("../../img/images/banner-cut.png").default} />
          <div className={styles.content}>
            <Link>BÁN HÀNG ĐA KÊNH – XU HƯỚNG MỚI CỦA BÁN LẺ HIỆN ĐẠI</Link>
            <p>27-02-2021</p>
          </div>
        </div>
        <div className={styles.news}>
          <img src={require("../../img/images/banner-cut.png").default} />
          <div className={styles.content}>
            <Link>BÁN HÀNG ĐA KÊNH – XU HƯỚNG MỚI CỦA BÁN LẺ HIỆN ĐẠI</Link>
            <p>27-02-2021</p>
          </div>
        </div>
      </Col>
    </Row>
  );
};

export default NewestPost;
